import React from "react";
import FormBuilder from "./FormBuilder";
import FormSubmit from "./FormSubmit";
import FormSubmissions from "./FormSubmissions";
import Table from "@material-ui/core/Table";

import TableBody from "@material-ui/core/TableBody";

import TableCell from "@material-ui/core/TableCell";

import TableContainer from "@material-ui/core/TableContainer";

import TableHead from "@material-ui/core/TableHead";

import TableRow from "@material-ui/core/TableRow";

import Paper from "@material-ui/core/Paper";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function FormsList() {
  return (
    <Router>
      <div>
        {" "}
        <nav>
          <ul>
            <li>
              <Link to="/FormBuilder">create new form</Link>
            </li>
          </ul>
        </nav>
      </div>

      <div>
        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/FormBuilder">
            <FormBuilder />
          </Route>
          <Route path="/FormSubmit">
            <FormSubmit />
          </Route>
          <Route path="/FormSubmissions">
            <FormSubmissions />
          </Route>
          <Route path="/">
            <div className="FormsList">
              <TableContainer component={Paper}>
                <Table stickyHeader aria-label="sticky table">
                  <TableHead>
                    <TableRow>
                      <TableCell>Id</TableCell>

                      <TableCell align="right">Form Id</TableCell>

                      <TableCell align="right">Form Name</TableCell>

                      <TableCell align="right"># Submissions</TableCell>

                      <TableCell align="right">Submit Page </TableCell>

                      <TableCell align="right">Submissions Page</TableCell>
                    </TableRow>
                  </TableHead>

                  <TableBody>
                    {/* {this.state.ProductData.map((p, index) => { */}
                    {/* return ( */}
                    <TableRow key={index}>
                      <TableCell component="th" scope="row">
                        {1}
                      </TableCell>

                      <TableCell align="right">a</TableCell>

                      <TableCell align="right">b</TableCell>

                      <TableCell align="right">c</TableCell>

                      <TableCell align="right">d</TableCell>

                      <TableCell align="right">e</TableCell>
                    </TableRow>
                    );
                    {/* })} */}
                  </TableBody>
                </Table>
              </TableContainer>
              {/* <table style={{ width: "50%" }}>
                <tr>
                  <td>Form Id</td>
                  <td>Form Name</td>
                  <td># Submissions</td>
                  <td>Submit Page</td>
                  <td>Submissions Page</td>
                </tr>
              </table> */}
            </div>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default FormsList;
